export default (props) =>{
    return(
  <div class="row  row-cols-md-3 g-4">
   
    
        <img src={props.Foto} class="card-img-top" alt="..."/>
        <h4 className="media-heading">Bariloche (Argentina) </h4>
 <p>Passagem + Hospedagem <br/> Parcele em ate 10 vezes no Cartão</p>
    </div>
    );
    }
